INSERT INTO `expoprompts` VALUES (1,'Select the Shifts that Interest You\r\n','Below are all of the volunteer shifts available. Select the YES radio button forall of the shifts that interest you and to which you can commit!\r\n<p />\r\nClick on each day to see available volunteer shifts for that day. Drill down further by clicking on an event to see a description of that event. You&apos;ll have the next page to review what you selected!\r\n<p />\r\nClick next at the bottom of the page once you have selected your favorites.','Select the Shifts that Interest You','Below are all of the volunteer shifts available. Select the YES radio button forall of the shifts that interest you and to which you can commit!\r\n<p />\r\nClick on each day to see available volunteer shifts for that day. Drill down further by clicking on an event to see a description of that event. You\'ll have the next page to review what you selected!\r\n<p />\r\nClick next at the bottom of the page once you have selected your favorites.','Here are the events you selected:','Below are all the sessions you\'ve shown interest in. You\'re welcome to trim down the list. You MUST set a maximum number of hours at the bottom of the page (it is defaulted to 20), and we\'ll schedule you for where we need you the most!\r\n<p />\r\nNote: Our system won\'t allow us to double book you, so if you have two sessions at the same time, you\'ll only be scheduled for one. Also know that if you requested more shifts than the maximum amount of hours you can commit, you will not be booked to all of the events you selected.\r\n<p />\r\nClick next at the bottom of the page once you are comfortable with your selections.');
/*!40000 ALTER TABLE `expoprompts` ENABLE KEYS */;
