INSERT INTO `station` VALUES (2,1,'2012-10-08 10:00:00','2012-10-08 15:00:00','Talk:  Social Entrepreneurship: My Venture Changes the World. Can Yours? Presented by University of Illinois','The convergence of the for-profit and non-profit sector is completely changing our experience as consumers. What is the significance of these companies as they attempt to solve global problems as well as reshape business models?','Goodman Theater- Albert  Theater','http://www.chicagoideas.com/talks/27',NULL),(3,1,'2012-10-08 10:30:00','2012-10-08 15:00:00','Talk:  Social Entrepreneurship: My Venture Changes the World. Can Yours? Presented by University of Illinois','The convergence of the for-profit and non-profit sector is completely changing our experience as consumers. What is the significance of these companies as they attempt to solve global problems as well as reshape business models?','Goodman Theater- Albert  Theater','http://www.chicagoideas.com/talks/27',NULL),(4,1,'2012-10-08 14:30:00','2012-10-08 20:00:00','Talk: Military: Frontline to Homefront,                             Presented by Chase and J.P. Morgan -AND- Talk: Tech: Change is the Constant, Presented by Microsoft','Approximately five million Americans served in uniform since September 11, 2001 and nearly 2.5 million were deployed to Iraq or Afghanistan.  As war winds down, what\'s next for returning soldiers?  How do veterans acclimate to a civilian lifestyle?  And what can you do to help those who put their lives on the line to fight for your freedom? \n\n -AND- \n\nInnovation in technology changes by the second; today\'s breakthrough can be archaic by tomorrow. There will always be something faster, smarter and stronger to replace current trends. Our speakers will address the latest and greatest in sites, apps, resources, gadgets and more, while sharing what the future will look like in this constantly evolving field.','Goodman Theater- Albert Theater','http://www.chicagoideas.com/talks/28; http://www.chicagoideas.com/talks/55',NULL),(5,1,'2012-10-08 15:00:00','2012-10-08 20:00:00','Talk: Military: Frontline to Homefront,                             Presented by Chase and J.P. Morgan -AND- Talk: Tech: Change is the Constant, Presented by Microsoft','Approximately five million Americans served in uniform since September 11, 2001 and nearly 2.5 million were deployed to Iraq or Afghanistan.  As war winds down, what\'s next for returning soldiers?  How do veterans acclimate to a civilian lifestyle?  And what can you do to help those who put their lives on the line to fight for your freedom?  -AND- Innovation in technology changes by the second; today\'s breakthrough can be archaic by tomorrow. There will always be something faster, smarter and stronger to replace current trends. Our speakers will address the latest and greatest in sites, apps, resources, gadgets and more, while sharing what the future will look like in this constantly evolving field.','Goodman Theater- Albert Theater','http://www.chicagoideas.com/talks/28; http://www.chicagoideas.com/talks/55',NULL),(6,1,'2012-10-08 14:30:00','2012-10-08 19:30:00','Talk: Design: Shaping Space','Design is all around us: on our desks, in our phones, and on our computer screens. Everything we do or use has a function of its own; and the look, shape, feel, and function affects everything from our success to our mood. This incredibly diverse group of designers describes how they, quite literally, create our world.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/24',NULL),(7,1,'2012-10-08 15:00:00','2012-10-08 19:30:00','Talk: Design: Shaping Space','Design is all around us: on our desks, in our phones, and on our computer screens. Everything we do or use has a function of its own; and the look, shape, feel, and function affects everything from our success to our mood. This incredibly diverse group of designers describes how they, quite literally, create our world.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/24',NULL),(8,1,'2012-10-08 17:00:00','2012-10-08 22:00:00','Mega-Talk: Democracy: State of Our Union','Our country\'s top political analysts will take an in-depth look at our political history and discuss how the 2012 election will influence our future. ','Oriental Theater','http://www.chicagoideas.com/talks/25',NULL),(9,1,'2012-10-08 17:30:00','2012-10-08 22:00:00','Mega-Talk: Democracy: State of Our Union','Our country\'s top political analysts will take an in-depth look at our political history and discuss how the 2012 election will influence our future.','Oriental Theater','http://www.chicagoideas.com/talks/25',NULL),(10,1,'2012-10-09 06:30:00','2012-10-09 14:30:00','Talk: Economy: Checks and Balances, Presented by The Joyce Foundation -AND- Talk: Energy: Scalable Solutions','The economy is unsteady for numerous reasons, but what if we can fix it with atypical, yet simple solutions \' education and job training.  The country\'s leading economists will have a lively discussion on human capital development and all things financial.   -AND- What would the world look like without oil? Can we prevent another influx of natural disasters?  Will our planet run out of water? Environmental experts propose solutions for climate change, diminished natural resources and more.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/29; http://www.chicagoideas.com/talks/30',NULL),(11,1,'2012-10-09 07:00:00','2012-10-09 14:30:00','Talk: Economy: Checks and Balances,                          Presented by The Joyce Foundation -AND- Talk: Energy: Scalable Solutions','The economy is unsteady for numerous reasons, but what if we can fix it with atypical, yet simple solutions \' education and job training.  The country\'s leading economists will have a lively discussion on human capital development and all things financial.   -AND- What would the world look like without oil? Can we prevent another influx of natural disasters?  Will our planet run out of water? Environmental experts propose solutions for climate change, diminished natural resources and more.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/29; http://www.chicagoideas.com/talks/30',NULL),(12,1,'2012-10-09 10:00:00','2012-10-09 15:00:00','Talk: Cities: Local Ties, Global Impact,                           Presented by Chase and J.P. Morgan -AND- Talk: Storytellers: The Power of Perspective','More people now live in urban areas than rural communities worldwide. CIW analyzes the effect that cities have on society, what the future of the city looks like and the nature of our emotional attachment to these thriving urban spaces.  -AND- Musicians, filmmakers, artists, and writers all share one thing in common -- they offer us compelling stories. Great stories stand at the center of how we remember the past and what we hope for in the future. Hear from iconic storytellers on how they see, tell, and create great stories.','Goodman Theater','http://www.chicagoideas.com/talks/32; http://www.chicagoideas.com/talks/52',NULL),(13,1,'2012-10-09 10:30:00','2012-10-09 15:00:00','Talk: Cities: Local Ties, Global Impact,                           Presented by Chase and J.P. Morgan -AND- Talk: Storytellers: The Power of Perspective','More people now live in urban areas than rural communities worldwide. CIW analyzes the effect that cities have on society, what the future of the city looks like and the nature of our emotional attachment to these thriving urban spaces.  -AND- Musicians, filmmakers, artists, and writers all share one thing in common -- they offer us compelling stories. Great stories stand at the center of how we remember the past and what we hope for in the future. Hear from iconic storytellers on how they see, tell, and create great stories.','Goodman Theater','http://www.chicagoideas.com/talks/32; http://www.chicagoideas.com/talks/52',NULL),(14,1,'2012-10-08 14:30:00','2012-10-08 19:30:00','Talk: Web: Life Online, Presented by Cars.com','The Internet has revolutionized how we live, shop, communicate, travel, eat, play games, watch TV and practically how we breathe. Has it improved lives or taken over? Experts will educate our audience on how the web affects every aspect of our life \'from privacy, piracy, data gathering and more\' what is the impact on a life online?','MCA','http://www.chicagoideas.com/talks/33; http://www.chicagoideas.com/talks/35',NULL),(15,1,'2012-10-09 15:00:00','2012-10-09 19:30:00','Talk: Web: Life Online, Presented by Cars.com','The Internet has revolutionized how we live, shop, communicate, travel, eat, play games, watch TV and practically how we breathe. Has it improved lives or taken over? Experts will educate our audience on how the web affects every aspect of our life \' from privacy, piracy, data gathering and more \' what is the impact on a life online?','MCA','http://www.chicagoideas.com/talks/33; http://www.chicagoideas.com/talks/35',NULL),(16,1,'2012-10-09 14:30:00','2012-10-09 19:30:00','Talk: Giving: One Matters --AND-- Identity: What Makes Me...Me?, Presented by MSL Chicago','One dollar, one hour, one click. CIW examines the role philanthropy can have in tackling some of the world\'s greatest problems\'and how one can make a difference.  --AND-- How do we become who we are? Is our personality determined by genetics and the wiring of our brains at birth, or built over time through memory and experience? This exploration into our identities and who we are affects everything we see, feel, and do.','Goodman Theater','http://www.chicagoideas.com/talks/31',NULL),(17,1,'2012-10-09 15:00:00','2012-10-09 19:30:00','Talk: Giving: One Matters --AND-- Identity: What Makes Me...Me?, Presented by MSL Chicago','One dollar, one hour, one click. CIW examines the role philanthropy can have in tackling some of the world\'s greatest problems\'and how one can make a difference.  --AND-- How do we become who we are? Is our personality determined by genetics and the wiring of our brains at birth, or built over time through memory and experience? This exploration into our identities and who we are affects everything we see, feel, and do.','Goodman Theater','http://www.chicagoideas.com/talks/31',NULL),(18,1,'2012-10-09 17:00:00','2012-10-09 22:00:00','Mega-Talk: Disruptive Innovation: Reinventing Our World,      Presented by TIME','How do individuals disrupt the status quo with an idea or invention that refuses to abide by the rules, opening the world up to something entirely new in an accessible and compelling way?  Hear directly from these disruptor innovators on why and how they create.','Oriental Theater','http://www.chicagoideas.com/talks/34',NULL),(19,1,'2012-10-09 17:30:00','2012-10-09 22:00:00','Mega-Talk: Disruptive Innovation: Reinventing Our World,      Presented by TIME','How do individuals disrupt the status quo with an idea or invention that refuses to abide by the rules, opening the world up to something entirely new in an accessible and compelling way?  Hear directly from these disruptor innovators on why and how they create.','Oriental Theater','http://www.chicagoideas.com/talks/34',NULL),(20,1,'2012-10-10 10:00:00','2012-10-10 15:00:00','Talk: Art: How It Moves','How is art used as a vehicle for good, a method for inspiring change, or a symbol of protest?  Why does it evoke strong emotions in many and nothing in others?  CIW will look into the future of art with world-renowned and everyday artists discussing its impact on everyday life.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/36',NULL),(21,1,'2012-10-10 10:30:00','2012-10-10 15:00:00','Talk: Art: How It Moves','How is art used as a vehicle for good, a method for inspiring change, or a symbol of protest?  Why does it evoke strong emotions in many and nothing in others?  CIW will look into the future of art with world-renowned and everyday artists discussing its impact on everyday life.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/36',NULL),(22,1,'2012-10-10 10:00:00','2012-10-10 15:00:00','Talk: Future of News: What\'s the Story? Presented by TIME -AND- Talk: Water: The Ripple Effect','How will the news industry change over the next decade as we become an increasingly social media driven, paperless, and global society?  In collaboration with TIME, CIW investigates the effects these forces will have on the future of journalism and the news as we know it\n\n -AND- \n\nOur most precious resource is becoming more valuable by the day. Water affects and is effected by everything: it is the difference between life and death, health and sickness, rich and poor. CIW examines all aspects of the coming water crisis and the steps we can take now to solve it. ','Goodman Theater- Albert Theater','http://www.chicagoideas.com/talks/38; http://www.chicagoideas.com/talks/53',NULL),(23,1,'2012-10-10 10:30:00','2012-10-10 15:00:00','Talk: Future of News: What\'s the Story? Presented by TIME -AND- Talk: Water: The Ripple Effect','How will the news industry change over the next decade as we become an increasingly social media driven, paperless, and global society?  In collaboration with TIME, CIW investigates the effects these forces will have on the future of journalism and the news as we know it -AND- Our most precious resource is becoming more valuable by the day. Water affects and is effected by everything: it is the difference between life and death, health and sickness, rich and poor. CIW examines all aspects of the coming water crisis and the steps we can take now to solve it.','Goodman Theater- Albert Theater','http://www.chicagoideas.com/talks/38; http://www.chicagoideas.com/talks/53',NULL),(24,1,'2012-10-10 14:30:00','2012-10-10 21:00:00','Talk: Criminal Justice: Beyond the Verdict -AND- Intelligence Squared Debate','Our country is filled with a deep fascination of our legal system and the psychology of crime, but why?  Are we glorifying a broken system?  Here, meet some innovators who are improving or impacting the system to make a safer society for all.','Goodman Theater- Owen  Theater','http://www.chicagoideas.com/talks/40; http://www.chicagoideas.com/events/138',NULL),(25,1,'2012-10-10 15:00:00','2012-10-10 21:00:00','Talk: Criminal Justice: Beyond the Verdict -AND- Intelligence Squared Debate','Our country is filled with a deep fascination of our legal system and the psychology of crime, but why?  Are we glorifying a broken system?  Here, meet some innovators who are improving or impacting the system to make a safer society for all.','Goodman Theater- Owen  Theater','http://www.chicagoideas.com/talks/40; http://www.chicagoideas.com/events/138',NULL),(26,1,'2012-10-10 14:30:00','2012-10-10 19:30:00','Talk: Sports: The Making of a Champion','Is a champion born or made?  CIW explores the science of sport, the impact of sports marketing, and that \'magic thing\' that happens to great athletes and teams when the clock is running down.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/37',NULL),(27,1,'2012-10-10 15:00:00','2012-10-10 19:30:00','Talk: Sports: The Making of a Champion','Is a champion born or made?  CIW explores the science of sport, the impact of sports marketing, and that \'magic thing\' that happens to great athletes and teams when the clock is running down.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/37',NULL),(28,1,'2012-10-11 10:00:00','2012-10-11 15:00:00','Talk: Instigators: Stand for Something','What makes someone stands up against injustice?  Here are stories of ordinary people doing extraordinary things...and because they stood for something, their fight has likely changed your life. ','Goodman Theater- Owen  Theater','http://www.chicagoideas.com/talks/42',NULL),(29,1,'2012-10-11 10:30:00','2012-10-11 15:00:00','Talk: Instigators: Stand for Something','What makes someone stands up against injustice?  Here are stories of ordinary people doing extraordinary things...and because they stood for something, their fight has likely changed your life.','Goodman Theater- Owen  Theater','http://www.chicagoideas.com/talks/42',NULL),(30,1,'2012-10-11 14:30:00','2012-10-11 19:30:00','Talk: Work: No Longer Business as Usual,                       Presented by Ernst & Young -AND- Talk: Scientific Breakthroughs: Quantum Leaps,              Presented by University of Illinois','Today\'s job landscape is rapidly changing due to the economy, an influx of start-ups and technology, and our evolving definition of what a \'career\' really means.  Academics, CEOs, entrepreneurs, and economists predict what the future of work in the US looks like. \n\n -AND- \n\nCan you imagine a world with civilian space travel?  Contact lenses so smart that when you blink, you go online?  Or a society where cancer has been eradicated?  CIW explores these possibilities and more with a discussion of today\'s most incredible scientific breakthroughs.','Goodman Theater- Albert Theater','http://www.chicagoideas.com/talks/54; http://www.chicagoideas.com/talks/26',NULL),(31,1,'2012-10-11 15:00:00','2012-10-11 19:30:00','Talk: Work: No Longer Business as Usual,                       Presented by Ernst & Young -AND- Talk: Scientific Breakthroughs: Quantum Leaps,              Presented by University of Illinois','Today\'s job landscape is rapidly changing due to the economy, an influx of start-ups and technology, and our evolving definition of what a \'career\' really means.  Academics, CEOs, entrepreneurs, and economists predict what the future of work in the US looks like.  -AND- Can you imagine a world with civilian space travel?  Contact lenses so smart that when you blink, you go online?  Or a society where cancer has been eradicated?  CIW explores these possibilities and more with a discussion of today\'s most incredible scientific breakthroughs.','Goodman Theater- Albert Theater','http://www.chicagoideas.com/talks/54; http://www.chicagoideas.com/talks/26',NULL),(32,1,'2012-10-11 14:30:00','2012-10-11 22:00:00','Talk: Religion: Exploring the Unexpected -AND- Talk: Music: Tuning In','Religion is all at once one of the greatest sources of hope and pain in our society today.  Whole lives are transformed by it and whole societies are at war because of it.  Join this robust, honest, and civil dialogue about the ability of religion to enhance or undermine the human experience. -AND- CIW will discuss how musicians create, how we allow music to shape our relationships and personal identity and ultimately what the future of music looks like in a digital world.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/43; http://www.chicagoideas.com/talks/45',NULL),(33,1,'2012-10-11 15:00:00','2012-10-11 22:00:00','Talk: Religion: Exploring the Unexpected -AND- Talk: Music: Tuning In','Religion is all at once one of the greatest sources of hope and pain in our society today.  Whole lives are transformed by it and whole societies are at war because of it.  Join this robust, honest, and civil dialogue about the ability of religion to enhance or undermine the human experience. -AND- CIW will discuss how musicians create, how we allow music to shape our relationships and personal identity and ultimately what the future of music looks like in a digital world.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/43; http://www.chicagoideas.com/talks/45',NULL),(34,1,'2012-10-11 17:00:00','2012-10-11 22:00:00','Mega-Talk: Meaning of Life: What\'s It\'s All About?','Nietzsche wrote, \'He who has a why to live can bear almost any how.\' But what is that \'why\'?  Together, world-renowned religious leaders, philosophers, scientists, atheists and artists explore the reason for human existence.\'','Oriental Theater','http://www.chicagoideas.com/talks/50',NULL),(35,1,'2012-10-11 17:30:00','2012-10-11 22:00:00','Mega-Talk: Meaning of Life: What\'s It\'s All About?','Nietzsche wrote, \'He who has a why to live can bear almost any how.\' But what is that \'why\'?  Together, world-renowned religious leaders, philosophers, scientists, atheists and artists explore the reason for human existence.\'','Oriental Theater','http://www.chicagoideas.com/talks/50',NULL),(36,1,'2012-10-13 08:00:00','2012-10-13 15:30:00','Talk: Education: New School -AND- Talk: Explorers: Seeking the Edge, Presented by Hyatt','The failure of the education system has become another polarized blame game: blame the unions; the teachers; the parents; standardized testing; the federal government.  Here, innovative reformers with positive results share their ideas for bettering education in non-traditional ways.  -AND- Is there anything left to discover in the 21st century? From the depths of the ocean to Mars and Antarctica, CIW explores the untapped world, making the case that the age of exploration is not a vestige of the past.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/46; http://www.chicagoideas.com/talks/44',NULL),(37,1,'2012-10-13 08:30:00','2012-10-13 15:30:00','Talk: Education: New School -AND- Talk: Explorers: Seeking the Edge, Presented by Hyatt','The failure of the education system has become another polarized blame game: blame the unions; the teachers; the parents; standardized testing; the federal government.  Here, innovative reformers with positive results share their ideas for bettering education in non-traditional ways.  -AND- Is there anything left to discover in the 21st century? From the depths of the ocean to Mars and Antarctica, CIW explores the untapped world, making the case that the age of exploration is not a vestige of the past.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/46; http://www.chicagoideas.com/talks/44',NULL),(38,1,'2012-10-13 14:30:00','2012-10-13 22:00:00','Talk: Fashion: Why Are You Wearing That?                   Presented by Chicago Magazine -AND- Talk: Comedy: What\'s So Funny?','What effect does the fashion industry, 