health care spending is the fifth largest economy in the world.  In addition to learning about health care reform, CIW aims to empower individual patients to manage their own healthcare in the best possible way. -AND- Speakers in this CIW session will share their creative process from beginning to end.  How is their creativity constantly evolving?  Learn from and be inspired to create during this Talk.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/51; http://www.chicagoideas.com/talks/47',NULL),(41,1,'2012-10-14 08:30:00','2012-10-14 15:30:00','Talk: Health & Wellness: Power to the Patient,              Presented by Walgreens -AND- Talk: The Creative Process: Stop Waiting for the Muse, Presented by Starcom MediaVest Group','It\'s widely reported the United States spends more on health care than any other country.  In fact, our health care spending is the fifth largest economy in the world.  In addition to learning about health care reform, CIW aims to empower individual patients to manage their own healthcare in the best possible way. -AND- Speakers in this CIW session will share their creative process from beginning to end.  How is their creativity constantly evolving?  Learn from and be inspired to create during this Talk.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/51; http://www.chicagoideas.com/talks/47',NULL),(42,1,'2012-10-14 14:30:00','2012-10-14 19:30:00','Talk: Food: Returning to Our Roots','Food is critical to our survival, but how can something so simple be so complex?  Let\'s return to our roots to learn about food basics; cooking, eating, shopping, growing, etc.','MCA Chicago- Edlis Neeson Theater','http://www.chicagoideas.com/talks/48',NULL),(43,1,'2012-10-14 15:00:00','2012-10-14 19:30:00','Talk: Food: Returning to Our Roots','Food is critical to our survival, but how can something so simple be so complex?  Let\'s return to our roots to learn about food basics; cooking, eating, shopping, growing, 