io station distinguish itself from the mind-boggling array of digital music streams available from across the Internet and beyond? WFMT, Chicago\'s Classical Experience, has some definite ideas about how to remain relevant in the digital age. You\'ll explore the challenges facing radio stations today and the strategies to meet overcome those obstacles.','WFMT Chicago\n5400 N. St. Louis Ave., Chicago, IL 60625','http://www.chicagoideas.com/events/93',NULL),(101,1,'2012-10-11 13:00:00','2012-10-11 17:00:00','Me So Far: Everybody\'s Interesting','Imagine learning in one evening what might take six dates, or years, to learn about someone. Be a part of the dating experiment with Me So Far. This CIW Labs exclusive is your chance to go behind the curtain and experience the formula that\'s attracted the attention of Gapers Block, The New York Times and countless singles.','Me So Far101 E Erie Street, Chicago, IL 60611','http://www.chicagoideas.com/events/113',NULL),(103,1,'2012-10-11 13:00:00','2012-10-11 17:00:00','The Onion: Honesty. Integrity. Cash.','The Onion is the most powerful, most terrifying and unquestionably the most influential media organization in the world. Join CEO Steve Hannah, The Onion\'s Scott Dikkers, and The A.V. Club\'s Josh Modell as they illuminate the astonishing history and success of The Onion and The A.V. Club. Presentations will coincide with a location tour and the exciting opportunity to gaze inside the belly of the satirical beast.','212 West Superior Street Chicago, IL 60654','http://www.chicagoideas.com/events/107',NULL),(104,1,'2012-10-11 14:00:00','2012-10-11 18:00:00','Doejo: Walk the Block With Doejo','Doejo has been a significant member of the Lakeview community since opening their doors in 2009. Join a walking tour of the neighborhood while hearing behind-the-scenes stories about projects Doejo helped launch. Tour includes stops & surprises at Doejo, Bow Truss Coffee Roasters and more.',' Bow Truss Coffee Roasters\n2934 N. Broadway 