'Lightbank Concert featuring Third Eye Blind:','Lightbank Concert featuring Third Eye Blind:','322 West Armitage Avenue, Chicago, IL 60614',NULL,NULL),(206,1,'2012-10-12 18:00:00','2012-10-12 23:30:00','Lightbank Concert featuring Third Eye Blind:','Lightbank Concert featuring Third Eye Blind:','322 West Armitage Avenue, Chicago, IL 60614',NULL,NULL),(207,1,'2012-10-11 19:30:00','2012-10-11 23:00:00','The CIW Afterglow Party','Spectaculat evening reception following \'The Meaning of Life\' Mega-Talk. Reception guests will include Deepak Chopra, Mitch Albom and others. Volunteers should wear black cocktail attire.','Bar Novo at The Renaissance Chicago Hotel 1 West Wacker Drive Chicago, IL 60601',NULL,NULL),(208,1,'2012-10-11 12:30:00','2012-10-11 16:30:00','Red Box: Fostering a Culture of Innovation','Join Redbox as they explore Building a Culture of Innovation. What does it take to transform an industry? How does that translate to other businesses? Discuss these questions and more as you\'re guided through Redbox adventures in launching new products and exploring new industries.','Red Box 1 Tower Lane, Oak Brook Terrace, IL 60181',NULL,NULL),(209,1,'2012-10-13 10:00:00','2012-10-13 14:00:00','Suite Partners: Inventing the Future with Robert Tercek','Join Suite Partners for the media industry preview of the new LiveLab show, Inventing the Future. Watch live as Robert Tercek, Digital Dozen member and perhaps the most prolific Internet revolutionary today, showcases emerging ideas in science, technology, media, entertainment and communications. Robert will give your brands and clients vital insight into \"whats next after whats next.\"','Kenmore Live Studio 678 N. Wells, Chicago, IL 60654',NULL,NULL),(210,1,'2012-10-12 07:00:00','2012-10-12 19:00:00','Edison Talk','All Day Shift','Oriental Theater',NULL,NULL),(211,1,'2012-10-12 07:00:00','2012-10-12 14:00:00','Edison Talk','Morning Shift','Oriental Theater',NULL,NULL),(212,1,'2012-10-12 14:00:00','2012-10-12 19:00:00','Edison Talk','Evening Shift','Oriental Theater',NULL,NULL),(213,1,'2012-10-08 07:30:00','2012-10-08 11:00:00','Headquarters - CIW Kickoff Breakfast Reception','Kickoff the week of CIW festivities at the HQ breakfast reception.  Our headquarters space for the week? Chicago\'s newest attraction- Block 37!!  Block 37 encompasses an entire city block in the heart of Chicago\'s downtown Loop and features an eclectic mix of shopping, dining and entertainment within a five-story atrium. The center has direct access to Chicago\'s Pedway as well as the CTA Red Line and Blue Line. HQ Volunteers will operate our onsite ticketing, badge, gadget gallery and merchandise areas. HQ Volunteers will also host CIW Sponsors that utilize our space for as a meeting and work station.','Block 37; 108 North State Street Chicago IL 60602',NULL,NULL),(214,1,'2012-10-10 15:00:00','2012-10-10 18:00:00','PROJECT YOU(th) Lab: Google','EMBARC students will receive an inside look at Google\'s Chicago space and get perspective on Google\'s history and future from the company\'s Chicago employees','Google Chicago 20 W. Kinzie, Chicago, IL 60654',NULL,NULL),(215,1,'2012-10-11 08:00:00','2012-10-11 11:30:00','The #WhatIfChicago Experiment @ CIW: Crowdsourcing Solutions to Chicagos Illegal Gun Problem','What would happen if an entire city joined together on Twitter to solve a critical issue like illegal guns on city streets? This month, CIW launched @whatifchicago to tap the Chicago community and beyond in search of innovative solutions to this issue. During this ultimate CIW Lab, civic, business and community leaders will explore ideas gathered from our community online, delving into evidence-based solutions that can make a significant difference.','gravitytank 114 W. Illinois St. #3, Chicago, IL 60654',NULL,NULL),(216,1,'2012-10-12 07:45:00','2012-10-12 10:45:00','PROJECT YOU(th) Lab: Nokia - ThinkChicago','Students from ThinkChicago will get a sneak peek at Nokia\'s collected location data and experience how this essential information is shaping the future. They\'ll see the complex technology used to build and maintain the world\'s most reliable maps. This Lab is an exclusive CIW PROJECT YOU(th) Lab and is not open to the public.','Nokia 4149 W. Monroe Ave., Chicago, IL 60624',NULL,NULL),(217,1,'2012-10-09 19:30:00','2012-10-09 23:30:00','Disruptive Innovation Exclusive Reception','Exclusive reception following the Disruptive Innovation MegaTalk.','222 W. Merchandise Mart Plaza',NULL,NULL);
