/*!50003 CREATE*/ /*!50017 DEFINER=`swifts6_EmailXL`@`localhost`*/ /*!50003 TRIGGER worker_insert AFTER INSERT
    ON worker FOR EACH ROW BEGIN
        INSERT INTO workerrole (workerid) VALUES (NEW.workerid);
        DELETE FROM invitation
            WHERE expirationDate < CURRENT_DATE
            OR (expoid IS NULL
            AND email = NEW.email);
        UPDATE invitation
            SET workerid = NEW.workerid, email = NULL
            WHERE email = NEW.email;
    END */;;
