    ON worker FOR EACH ROW BEGIN
        IF (NEW.isDisabled IS TRUE) THEN
            DELETE FROM workerexpo
                WHERE workerid = NEW.workerid
                AND expoid IN (SELECT expoid FROM expo WHERE stopTime > CURRENT_TIMESTAMP);
